import React from "react";
import chandra_mohan from './images/chandra_mohan.jpg';


function MyProducts() {
  return (
    <div>
       <ul>
        <li>Home</li>
        <li>About Us</li>
        <li>Blog</li>
        <li>Contact Us</li>
       </ul>
       <img src={chandra_mohan}/>
    </div>
  );
}

export default MyProducts;
